INSERT INTO feeds VALUES(6,'Extensão Tecnológica na Rede Federal',23,'2017-02-13 22:55:25.403056','2017-02-14 10:27:50.194032',NULL,NULL,'Os campi do IF Fluminense vêm a desempenhar crescentemente o papel de centros de excelência tecnológica e disseminadores de conhecimento para o aumento da produtividade e da competitividade da economia nacional. Os núcleos de inovação tecnológica, laboratórios organizados para a prestação de serviços técnicos e tecnológicos e os polos de inovação são alguns dos ambientes voltados ao atendimento das demandas dos setores produtivos.');
