INSERT INTO infos VALUES(15,'IFF oferece inovação tecnológica industrial para empresas instaladas na Codin','Fruto de disciplina do Mestrado em Engenharia Ambiental, oferecido no Campus Centro, projeto une academia e segmento produtivo. O resíduo descartado por uma empresa pode ser insumo de outra. Para saber o que cada uma oferece, bastará consultar o dado em um site. Esse sistema integrador está se tornando possível com a criação de um software desenvolvido pelo Polo de Inovação Tecnológico do Instituto. Seu resultado final deverá ser a criação de uma bolsa de resíduos. ','http://portal1.iff.edu.br/nossos-campi/campos-centro/noticias/iff-oferece-inovacao-tecnologica-industrial-para-empresas-instaladas-na-codin','',23,'2017-02-13 16:47:55.441945','2017-02-13 16:47:55.441945');
